import React from "react";
import golf from "./golf1.jpg";

function Hero() {
  return (
    <div class="flex items-center justify-center min-h-screen">
      <div class="flex items-center justify-between h-24 text-white bg-purple-600 rounded-lg shadow-md">
        <div class="flex flex-col px-4">
          <span class="text-2xl font-bold text-black">The new e-Golf</span>
          <p class="text-2xl font-semibold uppercase">19 Oct 2021</p>
        </div>
        <img src={golf} alt="The new e-Golf"></img>
      </div>
    </div>
  );
}

export default Hero;
